パイナップル味のサプリメントゼリー！！<BR><BR>
自然の美味しさをギュッと凝縮した美味しくて栄養補給が出来る小動物用ゼリーです。<BR>


たっぷり果汁に、失われがちな各種ビタミンを強化配合！<BR>
<BR>モルモットやデグー等に必要なビタミンＣをはじめ、体の活力を支える各種ビタミンをバランス良く配合しています。<BR>
うさぎやハムスター・モモンガなどにもＯＫ！<BR><BR>

【内容量】16ｇ×10ヶパック
<BR><BR>
【主原料】 
液糖・パイナップル果汁（濃縮還元）・ゲル化剤・マルチビタミン・トレハロース・クエン酸・香料 <BR><BR>
